} Consumer (consumer_id) { string ReceiveRow() : Called to receive one row for this consumer.
} Controller { StartShuffle() : Called before any producers or consumers start sending or receiving rows. EndShuffle() : Called after all producers and consumers have successfully sent and received all rows. } More at https://cloud.google.com/blog/products/bigquery/in-memory-query-execution-in-google-bigquery

